    webtoon_items = rank_section.find_all("li")

    # TOP 30만 잘라서 담을 리스트
    top30_list = []
    for idx, item in enumerate(webtoon_items[:30], start=1):
        # 웹툰 제목, 해당 웹툰 링크, 기타 정보를 추출
        # 예를 들어, <a> 태그 안에 텍스트로 제목, href로 링크가 있을 수 있음
        a_tag = item.find("a")
        if not a_tag:
            continue

        title = a_tag.get_text(strip=True)
        link = a_tag.get("href")  # 예: /webtoon/detail?blah...

        # 추가로 좋아요 수, 작가명 등을 가져오려면 해당 HTML 구조를 확인 후 find나 find_all 활용
        # 예시로 좋아요 수가 <span class="like_num">12345</span> 형태라면:
        # like_span = item.find("span", class_="like_num")
        # likes = like_span.get_text(strip=True) if like_span else "정보 없음"

        top30_list.append((idx, title, link))

    return top30_list

